require 'pry'
#find unique groups of letters
#if all letters are unique, return length
#each letter is its own substring
#when letters next to each other are the same, they are their own substring
#split string
##count length. This is base
#iterate through each with index
#if letters are the same, put them together
def count_homogenous(s)
  split = s.split('')
  base = split.count
  if split.uniq.count == base
    p base
  else 
    substrings(s)
    counter = 0
    @substrings.each do |sub|
      if sub.length == 1
        counter += 1
      else
        counter += (1..sub.length).sum
      # counter += 1 if sub.length == 1
      # counter += 3 if sub.length == 2
      # counter += 6 if sub.length == 3
      # counter += 10 if sub.length == 4
      # counter += 15 if sub.length == 5
      # counter += 21 if sub.length == 6
      end
    end
    p counter % (10**9 + 7)
  end
end

def substrings(s)
  @substrings = []
  s.scan(/((.)\2*)/) { |let| @substrings.push(let[0]) }
end

